import React from "react";
import TodoList from "./components/TodoList";
import Auth from "./components/Auth";  // See below for Auth

function App() {
  return (
    <div>
      <h1>Todo App</h1>
      <Auth />
      <TodoList />
    </div>
  );
}

export default App;
